pub enum EnumVariation {
    Rust {
        non_exhaustive: bool,
    },
    NewType {
        is_bitfield: bool,
    },
    Consts,
    ModuleConsts,
}

pub enum MethodKind {
    Constructor,
    Destructor,
    VirtualDestructor {
        pure_virtual: bool,
    },
    Static,
    Normal,
    Virtual {
        pure_virtual: bool,
    },
}

pub enum ItemKind {
    Module(Module),
    Type(Type),
    Function(Function),
    Var(Var),
}

pub enum ParseResult<T> {
    AlreadyResolved(ItemId),
    New(T, Option<clang::Cursor>),
}
